import React from 'react';
import Tag from '../Tag/Tag';
import tags from '../../tags';
import './AsideMenu.scss';

const AsideMenu = () => (
    <div className='aside-menu'>
        <div className='nav-aside-menu'>Etiquetas</div>
        {
            tags.map(tag => 
            <Tag
                // type={Tag.SIZES.BIG}
                key={tag.id}
                name={tag.name}
                color={tag.color}
            />)
        }
    </div>
)

export default AsideMenu
